## Tooltip

A tooltip is a small box that appears when you hover over an element. It is used to provide additional information about the element.

## React Context

React Context is a way to pass data from a parent component to a child component without having to pass the data through every level of the component tree. It is useful for passing data that is needed by many components, such as theme data or user data.

## Creating a Tooltip

To create a Tooltip in NextJS using React Context, we will first create a TooltipContext. This context will hold the state of the Tooltip, such as whether it is open or closed, and the content of the Tooltip.

We will then create a Tooltip component that uses the TooltipContext to display the Tooltip. The Tooltip component will take in a children prop, which is the element that the Tooltip will be attached to.

The Tooltip component will also take in a trigger prop, which is the event that will open the Tooltip. The trigger prop can be a string, such as 'hover', or a function that returns a boolean.

The Tooltip component will use the useContext hook to get the state of the Tooltip from the TooltipContext. It will then use the useEffect hook to open the Tooltip when the trigger prop is true.

The Tooltip component will also use the useEffect hook to close the Tooltip when the mouse leaves the Tooltip or the children element.

The Tooltip component will render the children element and the Tooltip content. The Tooltip content will be displayed when the Tooltip is open.

## Closing the Previously Opened Tooltip

To close the previously opened Tooltip, we will need to keep track of the previously opened Tooltip. We will do this by adding a previousOpenTooltip state to the TooltipContext.

When a Tooltip is opened, we will set the previousOpenTooltip state to the current Tooltip. When a Tooltip is closed, we will set the previousOpenTooltip state to null.

We will then use the useEffect hook in the Tooltip component to close the previously opened Tooltip when the Tooltip is opened.

## Example

Here is an example of a Tooltip in NextJS using React Context:

```
import React, { createContext, useContext, useEffect, useRef, useState } from 'react';

const TooltipContext = createContext();

export function useTooltipContext() {
  return useContext(TooltipContext);
}

export function TooltipProvider({ children }) {
  const [openTooltip, setOpenTooltip] = useState(null);
  const previousOpenTooltipRef = useRef(null);

  useEffect(() => {
    if (openTooltip) {
      previousOpenTooltipRef.current = openTooltip;
    }
  }, [openTooltip]);

  useEffect(() => {
    if (previousOpenTooltipRef.current && openTooltip !== previousOpenTooltipRef.current) {
      setOpenTooltip(null);
    }
  }, [openTooltip]);

  return (
    <TooltipContext.Provider value={{ openTooltip, setOpenTooltip }}>
      {children}
    </TooltipContext.Provider>
  );
}

export function Tooltip({ children, trigger, content }) {
  const { openTooltip, setOpenTooltip } = useTooltipContext();
  const tooltipRef = useRef(null);

  useEffect(() => {
    if (trigger) {
      setOpenTooltip(tooltipRef);
    }
  }, [trigger, setOpenTooltip]);

  useEffect(() => {
    const handleMouseLeave = () => {
      setOpenTooltip(null);
    };

    if (openTooltip === tooltipRef.current) {
      tooltipRef.current.addEventListener('mouseleave', handleMouseLeave);

      return () => {
        tooltipRef.current.removeEventListener('mouseleave', handleMouseLeave);
      };
    }
  }, [openTooltip, setOpenTooltip]);

  return (
    <div ref={tooltipRef}>
      {children}
      {openTooltip === tooltipRef.current && (
        <div className="tooltip">{content}</div>
      )}

